import React , {Component} from 'react';
import './App.css';
import CardList from './CardList';
import {Names} from './Data';
import Searchbox from './Searchbox';




class App extends Component{
  constructor() {
      super()
      this.state = {
        names : Names,
        searchfield: ''
      }
  }

  render() {
      return (
          <div className='page'>
            <h1>RoboFriends</h1>
            <Searchbox />
            <CardList data={Names}/>
          </div>
      );
  }

}


export default App;
